import './App.css';
import { Router , Switch , Route} from 'react-router-dom';
import HeaderComponent from './components/HeaderComponent';
import CategoriesComponent from './components/CategoriesComponent';
import RecommendedComponent from './components/RecommendedComponent';
import ImageComponent from './components/ImageComponent';
import FooterComponent from './components/FooterComponent';

function App() {
  return (
    <Router>
      <Switch>
      {/* <HeaderComponent /> */}
      <Route exact path='/header' component={HeaderComponent}></Route>
      <div class="container">
        {/* <CategoriesComponent />
        <RecommendedComponent />
        <ImageComponent /> */}
        <Route exact path='/cat' component={CategoriesComponent}></Route>
        <Route exact path='/rec' component={RecommendedComponent}></Route>
        <Route exact path='/img' component={ImageComponent}></Route>
      </div>  
      {/* <FooterComponent /> */}
      <Route exact path='/footer' component={FooterComponent}></Route>
      <Route exact path='/products' component={RecommendedComponent}></Route>
      </Switch>
    </Router>

  );
}
export default App;
